COPY public.news (id, title, content, excerpt, image_url, published_at, author_id, slug, is_published, created_at, updated_at) FROM stdin;
1	Sesión Ordinaria de Mayo	El Honorable Concejo Deliberante de Las Flores llevó a cabo su sesión ordinaria correspondiente al mes de mayo, donde se trataron importantes temas para la comunidad. Entre los puntos destacados se encontraron la aprobación del presupuesto para obras públicas y la discusión sobre nuevas ordenanzas de tránsito.	El HCD realizó su sesión mensual con importantes avances en temas de interés comunitario.	\N	2025-05-19 15:40:24.151712	1	sesion-ordinaria-mayo	t	2025-05-19 15:40:24.151712	2025-05-19 15:40:24.151712
2	Aprobación de Ordenanza Ambiental	El Concejo Deliberante aprobó por unanimidad la nueva ordenanza de protección ambiental que establece medidas para reducir la contaminación y promover prácticas sustentables en el municipio. La normativa incluye restricciones al uso de plásticos de un solo uso y fomenta el reciclaje.	Nueva normativa busca reducir la contaminación y promover prácticas sustentables.	\N	2025-05-19 15:40:24.151712	1	aprobacion-ordenanza-ambiental	t	2025-05-19 15:40:24.151712	2025-05-19 15:40:24.151712
3	Audiencia Pública por Transporte	Se llevó a cabo una audiencia pública en el recinto del Concejo Deliberante para discutir mejoras en el sistema de transporte público. Vecinos y concejales debatieron sobre frecuencias, recorridos y tarifas del servicio de colectivos urbanos.	Vecinos y concejales debatieron sobre el futuro del transporte público en la ciudad.	\N	2025-05-19 15:40:24.151712	1	audiencia-publica-transporte	t	2025-05-19 15:40:24.151712	2025-05-19 15:40:24.151712
4	Capacitacion en RCP en el HCD Las Flores	El dia Miercoles 21 se llevara a cabo una capacitación de RCP (Reanimación Cardio Pulmonar) en el edificio del H. Concejo Deliberante de nuestra ciudad.\r\nLa capacitación estara dirigida a todos los Concejales y empleados que allí se desempeñan.\r\nDesde la Secretaría de Salud Pública se continúa apostando a la prevención y capacitación brindando herramientas y conocimientos para distintos sectores de la sociedad.\r\nCuanto mayor sea la cantidad de ciudadanos que estén en conocimiento y preparados para la realización de dichas prácticas, más alta será la probabilidad de salvar una vida.	El dia Miercoles 21 se llevara a cabo una capacitación de RCP (Reanimación Cardio Pulmonar) en el edificio del H. Concejo Deliberante de nuestra ciuda...	https://res.cloudinary.com/dpn8we0s3/image/upload/v1747680852/news/hwbjjz5e3ewzi14zutdd.webp	2025-05-19 18:54:14.030231	1	capacitacion-en-rcp-en-el-hcd-las-flores	t	2025-05-19 18:54:14.030231	2025-05-19 18:54:14.030231
\.
